import React from 'react';
import './card.css'

function Card () {
  return (
    <div className="card">
      <h1>{this.props.title}</h1>
      <h3>{this.props.technologies}</h3>
      <p>{this.props.description}</p>
      <p>Code</p>
      
    </div>
  );
}

export default Card;
